:4:\"desc\";s:166:\"1.喜欢食用如水/牛奶/面包/蛋糕/生菜/南方水果等让身体变冷的阴性食物;\r\n2.腹部，特别是肚腩下方是冰冷的;\r\n3.腹部肌肉衰弱\r\n\";s:8:\"solution\";s:218:\"您的消化系统分解、吸收、排泄功能不完整，造成便秘,建议避免辛辣，并食用消化Ⅲ型调理;\r\n您的胃肠蠕动能力不足，建议平时避免辛辣，同时食用消化Ⅲ型调理\r\n\r\n\";s:7:\"betters\";s:11:\"1,2,3,12,17\";s:10:\"createtime\";s:10:\"1477551010\";s:6:\"detail\";s:4:\"65_1\";}}}i:4;a:5:{s:2:\"id\";s:2:\"13\";s:4:\"name\";s:6:\"四肢\";s:8:\"priority\";s:1:\"4\";s:5:\"count\";i:1;s:9:\"questions\";a:1:{i:0;a:12:{s:2:\"id\";s:2:\"68\";s:7:\"uniacid\";s:1:\"8\";s:3:\"pid\";s:2:\"13\";s:10:\"product_id\";s:2:\"11\";s:4:\"name\";s:12:\"关节疼痛\";s:4:\"type\";s:1:\"3\";s:7:\"sickImg\";s:51:\"images/8/2016/10/wQ15dgB1pdnIqrhWXqcG9oNZqDoHpZ.jpg\";s:4:\"desc\";s:148:\"1.喝很多茶，水，咖啡等饮料;\r\n2.腹部（即身体的中心点处）寒冷（表示全身是冷的）;\r\n3.尿量较少;\r\n4.关节红肿\r\n\";s:8:\"solution\";s:364:\"您的免疫细胞功能障碍，对关节细胞产生自身“攻击”，关节功能受损，有风湿痛的风险，建议您尽量减少身体负重，并食用免疫II型辅助调理;\r\n您的免疫系统细胞自身辨别能力有障碍，或循环不畅，造成关节功能受损，建议您尽量减少身体负重，并食用免疫II型辅助改善\r\n\r\n\r\n\";s:7:\"betters\";s:11:\"1,2,3,17,23\";s:10:\"createtime\";s:10:\"1477551166\";s:6:\"detail\";s:0:\"\";}}}i:3;a:5:{s:2:\"id\";s:2:\"14\";s:4:\"name\";s:6:\"综合\";s:8:\"priority\";s:1:\"3\";s:5:\"count\";i:1;s:9:\"questions\";a:1:{i:0;a:12:{s:2:\"id\";s:2:\"81\";s:7:\"uniacid\";s:1:\"8\";s:3:\"pid\";s:2:\"14\";s:10:\"product_id\";s:1:\"7\";s:4:\"name\";s:6:\"肥胖\";s:4:\"type\";s:1:\"3\";s:7:\"sickImg\";s:51:\"images/8/2016/10/wnehde1fnBNJNnjTj8YqdfXND8XPh6.jpg\";s:4:\"desc\";s:199:\"1.吸取过量的水分，茶，咖啡;\r\n2.体温偏低，介于35℃~36℃;\r\n3.腹部冰冷（尤其是下腹部）;\r\n4.尿量较少;\r\n5.有便秘倾向;\r\n6.有下半身肥胖，萝卜腿的倾向\r\n\";s:8:\"solution\";s:283:\"您机体的血液、淋巴、水循环功能下降，造成肥胖，建议根据自身体能增加步行，并食用循环I型铺助改善;\r\n您机体内的血液、淋巴、水循环不畅，造成肥胖，建议您根据自身体能状况多步行，同时选用循环I型调理\r\n\";s:7:\"betters\";s:14:\"1,2,3,10,12,17\";s:10:\"createtime\";s:10:\"1477551606\";s:6:\"detail\";s:9:\"81_2.81_4\";}}}}recommend_products|N;','1478506221'),
