('1','8','0','6','','梁敏玲','images/8/2016/09/gOnFBM9wm22W22bNQWiS5e795MwWwW.jpg','5','我肩膀僵硬已经有一两年了，经常性的肩颈问题让我坐立难安，也影响到了我的睡眠，让我苦不堪言。每天一份900克的酵果菜谱，让我的苦日子有了盼头。3个月，我感觉肩膀僵硬出现频率减少了，多数为酸痛。到了150多天的时候，我感觉除了月经期间会出现肩颈疼痛外，其他时候都只是肩膀酸了。虽然现在我的肩颈问题还没有完全解决，但我对它有信心，我很期待接下来它带给我的惊喜。','a:0:{}','1473672121','0','','a:0:{}','','a:0:{}','','a:0:{}',' 35_女_会计','1'),
('2','8','0','5','','谭顺樟','images/8/2016/09/Ob1QZDlI1inmiy6L1qMmQI76b6s6Q6.jpg','5','以前我老觉得做梦是一件很正常的事情，还经常把做过的梦拿出来跟别人分享。可是梦做多了，回忆起来总会跟现实混淆。这时我才知道梦原来不是好的。吃了酵果菜谱到现在有3个月了，以前做梦到了第二天整天都还清楚梦境的内容，现在起床后就已经记不清。一点点改变，现在体力也比以前足了好多呢。','a:0:{}','1473672061','0','','a:0:{}','','a:0:{}','','a:0:{}',' 30_男_摄影师','1'),
('3','8','0','4','','Mr.Sun','images/8/2016/09/yLmU6M555CBC53fiC5Kc55C52ecF62.jpg','5','那时候，要睡一个好觉都与我来说是一个奢望。我是从2000年开始，就几乎每天晚上都没办法睡觉的，那会能睡两三个小时算不错了，有时烦躁到哭，我都想吃安眠药，朋友都劝我不要吃，但怎么办呢？同事给我推荐了酵果菜谱。吃“酵”果菜谱三天以后睡眠时间开始一天天增加，现在吃了四个月“酵”果菜谱，每晚可以睡五到六个小时，终于让我看到自己身体健康的曙光。今天这一切，都要感谢美丽天使公司对我的身体健康的关心和照顾。','a:0:{}','1473671975','0','','a:0:{}','','a:0:{}','','a:0:{}',' 20 _ 男_营养助理','1'),
('4','8','0','11','','富莱斯','images/8/2016/09/MklCr223WF2lZcCQoLM3f3cRsO2ckF.jpg','5','因为过敏性鼻炎跟着，所以鼻涕也跟着。熟人都知道我是一只鼻涕虫。这一点也不好笑，我讨厌这个称呼。可是我的过敏原无处不在，连空气里的灰尘也是。吃了酵果菜谱3个月后，虽然有时候会流鼻涕，可是次数比以前明显减少很多了。虽然我本身体质差，但是现在抵抗力有所增强，我已经很开心了！','a:0:{}','1473671922','0','','a:0:{}','','a:0:{}','','a:0:{}',' 22_ 女_ 保健助理','1'),
('5','8','0','10','','前程美好','images/8/2016/09/A0lbwilvwzkViDVz2D0lQEawdF7lz5.jpg','5','吃酵果菜谱以前的我，免疫力差，比自己身边的同学朋友一年要多上2、3次感冒。经过酵果菜谱的调理后，虽然在前三个月的初期调理中，仍有两次维持10天左右时间较长的感冒，但到了后期，体内环境得到净化，偶发感冒也只是维持了4天，感冒期大大缩短了。这个好转的现象，无论是在精神上、身体上还是经济上都大大减轻了我的负担，不得不给32个赞！','a:0:{}','1473671884','0','','a:0:{}','','a:0:{}','','a:0:{}',' 24_ 女_产品助理','1'),
('6','8','0','3','','ceallan','images/8/2016/09/ZBrDucc1nm5la76BrcBbdCC5cC3Rcm.jpg','5','我以前偶尔不排便，便秘程度还算比较轻，但主要是平时排出的便都比较硬，排便时也会费劲些。我想这也可能与我运动少有点关系。食用酵果菜谱的第一天，我就感觉排便顺利多了。第43天时，便秘也有很大的好转，除了后期因为国庆回家而打乱了饮食和作息出现便秘外，我天天都有排便。','a:0:{}','1473671851','0','','a:0:{}','','a:0:{}','','a:0:{}',' 35_女_ 仓管人员','1'),
('7','8','0','11','','彩云追月','images/8/2016/09/BtXCWE9c0TWXt02i2AtETheEH2ohtX.jpeg','5','有过敏性鼻炎的朋友们一定都知道我们的鼻子很脆弱，一点点的刺鼻气味和灰尘都会让我们的鼻子进入崩溃模式，狂打喷嚏、止不住的鼻水鼻涕。这种崩溃模式，严重影响我们的日常生活，休息不好、精神差和工作无法专心等等坏处。我在经过酵果菜谱的调理6个月后，偶然发现我进入空调温度较低的环境，身边没有过敏性鼻炎的同事在打喷嚏，但是自己却没有打喷嚏和流鼻涕的现象。感谢酵果菜谱改善了我的免疫力，让过敏性鼻炎离我越来越远。','a:0:{}','1473671771','0','','a:0:{}','','a:0:{}','','a:0:{}','23 _女_行政助理','1'),
('8','8','0','8','','静静','images/8/2016/09/qetmJ7U8jr2riE112Uk8yERAOu1ur7.jpg','5','我一般是在感冒或者发烧的情况下头就会有点头痛，但在食用酵果菜谱3个月里，我有感冒一次但没有再出现头痛。头痛的现象明显好转。110天后，我感冒时也不会再头痛了。','a:0:{}','1473671732','0','','a:0:{}','','a:0:{}','','a:0:{}','23_女_行政助理','1'),
('9','8','0','1','','黄小明','images/8/2016/09/e3mHzOHM3bYo7op7WnEu7NPqdN7g0h.jpg','5','３年前我去做体检，发现我有脂肪肝。我当时有点接受不了，毕竟脂肪肝会发展到肝功能异常，有些会发展到肝硬化。后来想想，我在外应酬多，自己饮食又不注意，腰围开始加大，脂肪肝也是情理之中。后来我刻意的想吃清淡一些，但总是管不了嘴巴。自从吃了酵果菜谱就不一样了，我在第１３天开始口味就变淡，油腻的东西吃多了就不舒服。而且我不得腰围在第９天就开始缩小了１０公分，随着时间的推移，我发现我自己胃肠有个“警报器”，吃多了就不舒服，所以饮食不由自主的控制下来。在１１月份，我再次做脂肪肝的复查，报告显示我的脂肪肝情况有好转，以前','a:0:{}','1473671692','0','','a:0:{}','','a:0:{}','','a:0:{}','41_男_医生','1'),
('10','8','0','9','','胜红','images/8/2016/09/J6YZJV7gZ4oTwTYfmoJyF7txV7OEG6.jpg','5','医生说我的腹部冰凉是躯体循环不足造成，为了改变这种情况，我选择了能整体上从八大系统出发来调理身体的健康代餐——酵果菜谱。3个月多的时间我就感觉自己的腹部由冰转暖了，而且现在腹部也没再变回冰凉过，真的很有效。','a:0:{}','1473671661','0','','a:0:{}','','a:0:{}','','a:0:{}','38_女_仓管人员','1'),
('11','8','0','7','','坚持','images/8/2016/09/qL1a6zlf45sMfcQfi5mc4fYxj6IIF4.jpg','5','以前如果在精神压力过大，工作繁忙的时候偶尔出现心律不整，虽然说目前没有其他不舒服的，但始终不是好事。通过酵果菜谱的改变，给我的意外收获就是食用期间再也没有出现心律不整现象。','a:0:{}','1473671627','0','','a:0:{}','','a:0:{}','','a:0:{}','40_女_经理','1'),
('12','8','0','2','','小刚','images/8/2016/09/ZSmNuq3S58VoOWuAaYXkayxO5fOfNA.jpg','5','我喝水量不多，每天大概半瓶矿泉水500毫升左右，所以经常会感觉喉咙有点干。在食用了酵果菜谱之后的一周时间，我的嘴唇干现象就有好转，53天后，我的嘴唇和喉咙就不再干了','a:0:{}','1473671586','0','','a:0:{}','','a:0:{}','','a:0:{}','37_男_仓管人员','1'),
('13','8','5','3','o1Sf9wuUDDS_BM0G-CbKx2umOImU','YK','http://wx.qlogo.cn/mmopen/DQgGDOqYFIZBPGzW3vRQaIl8Ujo5AlJqOS1nwdg4lYMDhqbJ7B6KIaGoKMYR38aQqy19jn5JnIiadEnafzaoickNHaX1QJXedy/132','5','好好的啊','a:0:{}','1473755945','0','','','','','','','','1'),
('14','8','5','2','o1Sf9wuUDDS_BM0G-CbKx2umOImU','YK','http://wx.qlogo.cn/mmopen/DQgGDOqYFIZBPGzW3vRQaIl8Ujo5AlJqOS1nwdg4lYMDhqbJ7B6KIaGoKMYR38aQqy19jn5JnIiadEnafzaoickNHaX1QJXedy/132','5','好好的啊','a:0:{}','1473755945','0','','','','','','','','0'),
('15','8','0','1','','二次元','images/8/2016/09/o2pc5K7qKZeFGkUVoc2oP25g6hRGHu.jpg','4','我的胃病有好几年了，主要症状有胃胀、反酸、打嗝和胃痛。胃胀很经常，几乎5天中就有3天。这对于好吃的我来说真的是一种折磨。我很容易打嗝，而且还是一打就是好几个小时的那一种，在这期间，我偶尔也会反酸，那种好像咽喉泡在烈酒般火辣辣的感觉还真不是一般的‘爽’；至于胃痛的发作比较不规律，但那种感觉，真是让人此生难忘。后来有了酵果菜谱帮我调理的近5个多月的时间里，我的胃痛就没再犯过。当调理到15天后，我就很少出现打嗝了，当调理到20天的时候，我的胃胀明显就减少了，慢慢地，我反酸也几乎没有再出现过。','a:0:{}','1475038366','0','','a:0:{}','','a:0:{}','','a:0:{}','25_女_文案','1'),
('16','8','0','1','','珍珍','images/8/2016/09/CzZ90qA0Q490A7Asa79zhM3H37zo3s.jpg','4','小时候的我是个药罐子，经常生病吃中药，到时一些色素沉淀在身体里，皮肤呈现出来是典型的黄种人。吃了酵果菜谱后，由于先天体质的影响，虽然皮肤没有变白，但是油性皮肤的我油脂减少了，毛孔变小了，皮肤细腻了。皮肤变好了，自我感觉也跟着变好了！','a:0:{}','1475046445','0','','a:0:{}','','a:0:{}','','a:0:{}','22_女_行政文员','1'),
('17','8','3','2','o1Sf9wkKBQehW95uXJpMpNu1EkCg','星星','http://wx.qlogo.cn/mmopen/bTFic2l1U8asX7jbnN411qFqwyRQib86VY924c2aUnibRhiaDR2F3aCaofPBbFD1hJ3d8lc3rgFjFPRuKsffBQtnNtmJd1mc13CZ/132','5','很不错','a:0:{}','1478186701','0','','','多谢','a:0:{}','','a:0:{}','__','1');
