INSERT INTO ims_lrj_guide_better VALUES 
('1','8','饥饿感(胃肠清空感)','凡食物分解的代谢过程中必有残渣产生。酵果菜谱清理陈旧残渣，腾出机体细胞更新空间，产生饥饿感。与“七分饱，活到老”同理。\r\n  实例参考：此现象最短1天消除，既往体质较差者最长56天消除。\r\n  温馨提示：\r\n a. 减肥者：饥饿感的现象为阶段性现象，会渐渐减缓，直至消失；\r\n b. 饥饿感也提示机体有补充营养食物的空间，增强体能。\r\n饥饿感强烈者：根据个人体质食用适当的五谷、蔬果等缓和。\r\n','1475389328'),
('2','8','肠鸣','酵果菜谱促进胃肠蠕动，把代谢残渣加速排出，产生肠鸣。此现象为消化分解、吸收、排泄功能提升的“欢乐颂”。\r\n 实例参考：42%半个月后消除，29%两个月后消除，29%三个月后消除(第2、3个月此现象出现为间歇性)','1475389846'),
('3','8','排气次数增加','人体垃圾有三态，气态、液态、固态。气态杂质在肠道堆积，腹部胀气，逆流引发打嗝。酵果菜谱净空胃肠道，及时排出肠道气体。排出后胃肠轻松，腹胀也逐步消除（甚至出现腰围减少）。\r\n 实例参考：29%在第一个月现象消除；29%在第二个月现象消除；42%在第三个月现象消除（以上现象为间歇性）。\r\n 温馨提示：可在腹部顺时针轻揉，以促进排气，缩短调理进程。\r\n','1475389868'),
('4','8','排气有异味','异味与食物的种类、消化道陈旧垃圾、食物残渣沉积时间有关。酵果菜谱协助整理代谢后，排气逐渐没有异味，代表体质逐步碱化。\r\n 实例参考：33%在第一个月内消失，67%在两个月内消失。\r\n 温馨提示：\r\na.尽量避免食用高蛋白、高脂肪食物；\r\nb.每天安排时间做简单运动：散步等。\r\n','1475389895'),
('5','8','饱胀感','(1)原先胃肠蠕动慢，无明显饱胀感。酵果菜谱加快胃肠蠕动，食物在胃肠狭窄处发生暂时的堵塞，产生饱胀感。随着胃肠蠕动节律重新调整，饱胀逐步消除。例：一排车子在路上慢慢行走时，整条路线看起来仍然可通行，若其中部分车辆提速，就会发生阻塞，等全部车辆均提速，整体会更加流畅。\r\n  (2)由于食物吃得过多或过快所造成的。\r\n 实例参考：本现象最快一周解决，最久一个月解决。\r\n 温馨提示：\r\na.饱胀感明显者用美丽天使茶包约85℃温水泡制约250—300ml半小时，餐后两小时饮用可减轻饱胀感。\r\nb.酵果菜谱份量适当减半（调整期相应延长）。\r\nc.在腹部顺时针轻柔，或在胀痛处按压，以缩短饱胀时间。\r\n','1475389916'),
('6','8','口味变淡','酵素的活性降低会造成口味偏差，进而加重机体代谢负担。酵果菜谱激活人体的酵素，提升味蕾的敏感度，充分体验食物的天然滋味。此现象为开始改善酸性体质的标志，身体正向碱性体质方向迈进。\r\n 实例参考：100%半个月出现。\r\n','1475389931'),
('7','8','口腔有异味','由于消化、分解、吸收不完整，造成口腔异味（毒素不往下跑，就会往上串）。酵果菜谱帮助机体完善消化系统的代谢过程，残渣逐步被分解、排出，口腔异味逐渐消退。\r\n实例参考：本现象轻度在半个月后解决，重度半个月有改善，3个月后现象消失。\r\n温馨提示：\r\n   a.多漱口可缓解口腔异味；\r\n   b.三餐饮食重新搭配，尽量避免食用香辣、烤制、高动物蛋白类等食物，可选择食用植物性蛋白类食物，如：牛油果、豆类等。\r\n','1475389955'),
('8','8','反酸','形成反酸是由于①胃酸分泌过多，②胃蠕动受阻后，酸往上逆。酵果菜谱提供碱性资源，平衡胃酸分泌；促进胃肠蠕动，减少胃酸逆流；并逐步修复受损的胃粘膜，反酸现象逐步消失。  \r\n实例参考：轻者一个月解决，重者2个月解决（注：长期、严重者，不在此范畴之内）。\r\n温馨提示：用餐时，请尽量避免吃冰冷的食物、吃得过快或过多。\r\n','1475389983'),
('9','8','打嗝','打嗝为既往上消化道蠕动受阻，气体逆流形成。酵果菜谱恢复蠕动功能，气体不再上逆，打嗝现象会逐步消除。\r\n实例参考：67%打嗝现象第45天消失；33%(此案例为多年积存的困扰)第52天有改善，于以前相比打嗝频率、次数减少。\r\n温馨提示：用餐时，请尽量细嚼慢咽。\r\n','1475390006'),
('10','8','大便不成形','机体既往小肠进入大肠的部位，吸收水分、养分回收的能力减弱。酵果菜谱帮助肠道清除陈旧垃圾，改善肠道回收水分、养分的功能，使大便逐渐成形，同时体能最大化（营养不流失）。\r\n实例参考：为阶段性、间歇性现象，随着吸收能力加强，大便逐渐成型，89%在2个月内成型；其余11%与个人的饮食状况（难消化、食物的新鲜程度等）有关，调整饮食现象即解除。\r\n','1475390030'),
('11','8','大便次数增加','（1）人体消化道长9米，大部分盘踞在腹部，有很多拐弯的地方。肠道整理时，需分段整理；\r\n（2）消化代谢功能不完善，食物残渣易在体内积存，时间越久，积累越多，需逐步清理。\r\n积得多，排得多。酵果菜谱整理胃肠食物残渣，恢复胃肠正常蠕动，将陈旧物及时排到体外，逐步让体内环境净化（便后人体感觉轻松）。\r\n实例参考：最快食用后第一天出现，现象最慢第68天次数恢复至每天1－2次。\r\n温馨提示：为阶段性、间歇性现象。体内环境整理净化，大便次数恢复为每天1-3次。\r\n','1475390062'),
('12','8','大便有异味(臭味)','异味是因为陈旧性的食物残渣在体内不断发酵产生的，时间越久，异味越重。酵果菜谱中富含的酵素和果胶，能改善胃肠功能，清理胃肠过去的垃圾，还消化道、甚至机体“一片净土”。','1475390084'),
('13','8','疲倦','疲倦有以下2种情况：\r\n  (1)调整期若前晚睡眠不足，工作繁忙，易引起疲倦；\r\n  (2)为弥补过去体力、脑力透支（归零）所出现的过程，“有借有还，再借不难”。\r\n酵果菜谱中的酵素加快食物分解，使营养更全面地释放与吸收，从而增加体力；丰富的钙质稳定神经，改善睡眠品质，恢复体力与脑力。\r\n实例参考：本体验组体力、脑力归零时间为38天。\r\n温馨提示：\r\n  a.合理安排作息时间，酵果菜谱缩短疲倦时间；\r\n  b.食用人参丸，提升细胞含氧量，改善体能。\r\n','1475390357'),
('14','8','嗜睡','既往因脑力或体力透支引起嗜睡，睡眠是弥补透支的途径之一。酵果菜谱能稳定神经系统的调节，帮助恢复脑力、体力，细胞（尤其脑细胞）经修复后，精神状态会明显好转。\r\n实例参考：\r\n①最快出现时间为2天；\r\n②归零现象消失时间：最短持续38天后，最长第72天（现象出现时间共48天）。\r\n温馨提示：属于体力、脑力归零调整者，建议：晚上10点前睡觉，配合人参丸白天食用。\r\n','1475390384'),
('15','8','头晕（感到外周环境或自身在旋转、移动或摇晃）','头晕有以下2种情况：\r\n(1)生理期，孕期：因内分泌水平发生改变和循环不佳引起头晕；\r\n　疾病：如感冒、呼吸道感染中出现的状态，随疾病好转，现象消除；\r\n(2)为改善过去体力、脑细胞透支出现的现象（归零），头晕现象结束后，体力、脑力会上一个台阶。\r\n实例参考：本体验组的现象第38天消失。\r\n温馨提示：\r\n      a.根据自己头晕的程度，合理安排作息；\r\n      b.使用美丽天使活力垫，可促进脑部循环，缓解头晕现象；\r\n      c.建议服用活脑灵，促进脑循环的改善；\r\n','1475390411'),
('16','8','嘴唇干、咽喉干','既往自身水循环慢，体内水分代谢不佳。酵果菜谱加快水分的代谢，有利于排出体内可溶解于水中的杂质。嘴唇干、咽喉干为提升机体需补充水分，来弥补过去水分不足的信号。（“倒掉一杯脏水，再装一杯纯净水”）\r\n实例参考：\r\n（1）嘴唇干：最快消失3天，最慢消失19天。\r\n（2）喉咙干：最早出现在第3天，最迟出现15天，最快消失8天，最迟消失20天。\r\n温馨提示：及时补充水分\r\n   a.冬季最好补充，生姜红茶——有助于体温的提升；\r\n   b.夏季最好补充，自制柠檬水——有助于补充碱性资源；\r\n   c.补充纯净水（白开水）。\r\n','1475390432'),
('17','8','小便次数（量）增加','蛋白质和脂肪代谢残渣，有些需要溶解于水，通过尿液排出。当这些残渣有残留时，需加快排出以免“污染”机体。酵果菜谱启动新陈代谢，加快水分循环，小便量增加，使杂质及时排出，“不易久留”。随着小便次数的增加，小便颜色逐渐变浅、透明，无泡沫产生。\r\n实例参考：第1天100%出现，60%第1个月现象消失，40%在后期每天尿量与前天相同（较食用酵果菜谱前增加1－2次）。\r\n温馨提示：建议适当补充水分。\r\n','1475390449'),
('18','8','小便颜色深',' 1）体内水分缺乏（与疲劳、运动少、喝水少有关），尿色会加深，补充水分现象消失；\r\n 2）原水循环不佳，水溶性毒素堆积在体内，排出时加深尿的颜色。\r\n酵果菜谱加快水循环，分解食物残渣，加速体内液态毒素的排出，尿液颜色加深的同时，也逐步净化体内环境。\r\n实例参考：第1-6天出现，此后现象消失。\r\n温馨提示：可适量增加水分的补充\r\n  a.冬季最好补充，生姜红茶——有助于体温的提升；\r\n  b.夏季最好补充，自制柠檬水——有助于补充碱性资源；\r\n  c.补充纯净水（白开水）。\r\n','1475390467'),
('19','8','小便有泡沫消失慢','既往消化代谢、循环功能不佳，造成蛋白质在体内积存。酵果菜谱促进蛋白质的分解，蛋白质的液态代谢物随尿液及时排出体外，其黏性较大，产生泡沫且消失慢。体内环境净化，泡沫逐渐不再出现。\r\n实例参考：第36-90天出现（血液胆固醇高者）。\r\n温馨提示：小便有泡沫，且连续15天超过5分钟才消失，请进行相应的医疗检查。\r\n','1475390491'),
('20','8','皮肤干','既往肌肤油脂分泌较多，但肌肤保水功能不佳。\r\n酵果菜谱一方面需帮助肌肤油脂分泌均衡，水分均衡会随之调整；加快水循环，体内水分需及时补充。此为肌肤油脂、水分重新平衡的阶段性现象，水分补充充足即消失。（皮肤干预示着未来肌肤的锁水能力提升）\r\n实例参考：\r\n   (1)面部：50%在2个月内出现，现象维持3天完全消失；\r\n   (2)四肢：25%在第3个月出现仅1天，此现象消除；\r\n   (3)全身：25%在第1个月出现4天，此现象消除。\r\n温馨提示：\r\n  a.按照面部、四肢、全身皮肤干的范围，适当补充水分。\r\n  b.可使用美泉，在干燥部位每日早晚喷两次。\r\n','1475390521'),
('21','8','皮肤脱屑','水分缺乏时，角质层易剥离脱出。酵果菜谱加快了机体的新陈代谢，特别是促进水循环，有利于液态毒素排出，也带来肌肤的更新。皮肤脱屑为阶段性过程，体内水分达到进出平衡即消失。\r\n实例参考：补水3天后此现象消失。\r\n温馨提示：\r\na.按照面部、四肢、全身皮肤干的范围，适当补充水分。\r\nb.可使用美泉，在干燥部位每日早晚喷两次。\r\n','1475390563'),
('22','8','皮肤痒','皮肤痒有两种原因：\r\n①有过敏源存在，表皮的水分保护层消失；\r\n②新组织在生成，水分缺乏。\r\n酵果菜谱加快水分循环，皮肤水分重新均衡，肌肤组织更新，出现皮肤干痒。适当补水能缓解皮肤干痒的现象。\r\n实例参考：此现象只出现1次，最长3天后消失。\r\n温馨提示：适当补充水分，不建议用药物。\r\n','1475390584'),
('23','8','出红疹（既往有出现）','体内血液、淋巴循环薄弱时，毒素易在体内积存。酵果菜谱加快循环，促进血液、淋巴系统排毒，全身部位都有可能出现，但多数为四肢、关节处（循环薄弱）。出红疹能减少毒素的积存，对机体内部起到保护作用。（皮肤是血液、淋巴毒素排出的优选途径）\r\n实例参考：三个月期间，最多出现5次，最少出现3次，最长19天，最短2天。\r\n温馨提示：多喝水可促进淋巴排毒，同时少吃辛辣、刺激类食物。\r\n','1475390737'),
('24','8','耳前区疼痛','耳前淋巴循环不佳时，易造成毒素积存，酵果菜谱促进淋巴循环，排出毒素，清理淋巴循环的淤堵。（不排除，影响免疫力）\r\n实例参考：最快一周内消失，消失后原下颌/下巴处油脂粒逐步消除。。\r\n温馨提示：在耳前区疼痛处轻揉按摩，可帮助缩短疏通清理时间。\r\n','1475390754'),
('25','8','口腔肿痛','口腔是消化系统的一部分，与整个消化系统状态息息相关。酵果菜谱完善消化系统的功能，整理胃肠道沉积的食物残渣，口腔黏膜、牙周的淋巴组织也会随之得到整理，排出积存的毒素。随着体内净化，代谢增强，口腔肿痛会逐渐减轻至消失。（不排除，影响免疫力）\r\n实例参考：3天左右消失。\r\n温馨提示：可在口腔肿痛处按摩，缩短不适时间。\r\n','1475390772'),
('26','8','痘痘增多（既往痘痘大、痛、易留印）','既往油脂代谢障碍，毛孔堵塞，痘痘“应运而生”。酵果菜谱改善油脂分解代谢功能，促进原皮肤油脂的代谢物分泌排出（此时的痘痘颗粒小、消失快、不留印），帮助肌肤的更新，避免毛孔的堵塞，痘痘再无“立足之地”。（大痘化小，小痘化无）\r\n实例参考：最快第46天出现，第78天消失。\r\n温馨提示：\r\na.饮食方面，请尽量避免食用辛辣、油炸类食物；\r\nb.建议使用美泉，一天早晚净脸后喷用，促进肌肤更新代谢；\r\nc.青春期痤疮严重者，可配合绝痘王食用，以协助机体油脂代谢完整。\r\n','1475390793'),
('27','8','腰围缩小（好像又瘦了）','对于以下原状态，酵果菜谱会帮助腰围缩小：\r\n （1）消化功能不完善，食物残渣寄存在肠道，且被肠道菌群发酵产气；\r\n （2）体内酵素活性低，油脂分解不完全，脂肪沉积；\r\n （3）体内循环受阻，造成水潴留。\r\n“旧的不去，新的不来。”酵果菜谱恢复消化系统功能，完善食物的分解、排泄，减少肠道食物残渣的存留，同时加强胃肠蠕动能力，胀气排除；它激活体内酵素，完全分解多余脂肪；还加快水循环、淋巴循环和血液循环，加速脂肪分解和利用，减少腹部脂肪堆积。\r\n实例参考：\r\n         男性：最快第9天，\r\n         女性：最快第6天。\r\n温馨提示：偏瘦者，腰围缩小是一个阶段性的过程，酵果菜谱提升机体营养吸收能力，体重会逐渐增加，达到健康均衡的效果。\r\n','1475390818');
