('48','8','9','7','心跳过快','3','images/8/2016/10/s74f3Yg52FF7QDdgQLL5g2P32ez2Cd.jpg','1.茶，水，咖啡等水分摄取很多;\r\n2.舌头上水分很多，舌头边缘有牙齿痕状;\r\n3.发生在安静时分(副交感神经旺时);\r\n4.腹部有进水声;\r\n5.腹部寒冷;\r\n6.下腹部，下半身肥胖;\r\n7.排尿次数或排尿量较少(正常平均7~8次/天，共1500cc)\r\n','您心脏收缩、舒张功能不足，跳动稳定性不足，建议注意作息规律并食用循环Ⅰ型辅助改善;\r\n您心脏收缩、舒张功能不佳，建议平时注意作息，并选用循环Ⅰ型调理\r\n','1,2,3,16,17','1477550323'),
