('51','8','9','11','胸部寒冷并下腹部寒冷','2','images/8/2016/10/iyZM155GSUX95mxugH79BMsb79gY91.jpg','1,腹部向前方突出','您内分泌功能失衡，细胞可能会出现变异，有乳癌、卵巢癌或是子宫内膜癌的倾向，建议在相关医疗检查与治疗同时，您平时做扩胸运动，并食用免疫Ⅱ型辅助改善;\r\n您内分泌失调，循环不畅，会进一步影响机体的代谢正常化，建议您在相关医疗检查与治疗同时，多做扩胸运动，并食用免疫Ⅱ型调理\r\n','1,2,3,6,17,23','1477561365'),
('52','8','11','1','右上腹不适','3','images/8/2016/10/topnlEPLpeRXtx2XXbFbPElroabaTs.jpg','1.严重时出现黄疸(眼白变黄);\r\n2.恶心，呕吐;\r\n3.平时感到腹部冰冷;\r\n4.发烧（提示有胆囊炎）\r\n','您胆汁分泌异常，有胆结石、胆囊炎的倾向,建议平时少吃油腻食物，并选用消化I型辅助改善;\r\n您肝胆功能不佳，建议平时少吃油腻食物，选用消化I型辅助改善\r\n','1,2,5,6,8,9','1477550654'),
('53','8','11','1','吃较多油腻食物','3','images/8/2016/10/Ip222lFz2QY1S92L9ZFnJQ9QaynlZR.jpg','1.易疲劳，体力下降;\r\n2.口味比较重;\r\n3.胸部、肋骨处不适，不想束皮带或其他衣物;\r\n4.视物模糊\r\n','您肝功能下降，有脂肪肝的倾向,建议规律作息，并食用消化I型调理;\r\n您肝脏处理脂肪负担过重，建议规律作息，并选用消化I型调理\r\n\r\n','1,2,5,6,8,9','1477550672'),
('54','8','11','1','腹痛、腹泻','3','images/8/2016/10/U4n4Sn7PQ7cOYygopBq747R9ZpolZo.jpg','1.心窝处;\r\n2.右上腹;\r\n3.左上腹;\r\n4.右中腹;\r\n5.左中腹;\r\n6.小腹部(肚脐附近);\r\n7.下腹部\r\n','您的消化代谢工作未能完善，胃肠功能有待整理与修复，建议食用消化I型辅助调理;\r\n您的消化、分解、吸收及代谢有障碍，建议食用消化Ⅰ型辅助调理 \r\n\r\n','1,2,3,5,8,9','1477550691'),
