('56','8','11','4','提重物时，背部和腰部会酸疼','3','images/8/2016/10/o8mDmB7Y020md6lpbMD06l8DYimDTB.jpg','1.久坐时，背部腰部会疼;\r\n2.屁股着地，腰骨轻易骨折\r\n','您的骨质中有机钙含量偏低，可能有骨质疏松的风险,其根源与神经系统密切相关，建议平时做适量的日晒，并食用神经I型调理;\r\n您有骨质有机钙含量需要提升，而且循环也需要提升,建议平时做适量的日晒，并从代谢的根源入手，可选用神经I型调理\r\n\r\n\r\n','1,13,17','1477550725'),
('57','8','12','9','月经品质不佳','2','images/8/2016/10/UShiXmiD0ddiIHHwhX2DXsxsxHxXHd.jpg','1. 烦躁，心绪不安，焦虑，失眠;\r\n2.出疹子，发红，流汗;\r\n3.恶心，咳嗽，口腔炎;\r\n4. 喉咙阻塞;\r\n5. 肩膀僵硬;\r\n6. 呼吸困难，心悸;\r\n7. 下半身体温降低，若此现象一久时，上半身体温上升;\r\n8. 下腹部冰冷;\r\n9. 便祕，排尿困难，膀胱无力\r\n','您有内分泌水平失衡，影响每月的“阴晴圆缺”，干扰机体其他器官的正常运作秩序,其根源与神经系统、循环系统密切相关。您可以先从神经系统I型开始调整，后续加以循环III型改善;\r\n您有内分泌腺体分泌失衡，影响每月的“阴晴圆缺”,其根源与神经系统、循环系统密切相关。您可以先从神经系统I型开始调整，后续加以循环III型改善。\r\n','1,2,3,13,15,17','1477561446'),
('58','8','12','7','频尿(1):排尿时疼痛','3','images/8/2016/10/N8YfT892m1eD3Es2x1318aID6nxeyy.jpg','1.发烧;\r\n2.平常时下腹部冰冷;\r\n3.腰痛;\r\n4.血尿\r\n','您的泌尿系统“防御”出现障碍，有病菌侵犯入机体，有膀胱炎、肾盂肾炎的风险，为改善机体的水循环，增强泌尿系统防御能力，建议适当增加水分摄入，并选用循环Ⅰ型辅助改善;\r\n您的泌尿系统的“防御”出现障碍，病菌已侵犯粘膜组织，调理可从改善水循环，增强泌尿系统粘膜防御能力入手，建议适当增加水分摄入，并选用循环Ⅰ型作辅助改善\r\n\r\n','1,2,3,16,17','1477550845'),
