('60','8','12','4','更年期障碍','2','images/8/2016/10/si088I20wvmiZW0W52IMwitOI0yiV0.jpg',' 1.烦躁，心绪不安，焦虑，失眠症状明显;\r\n2. 出疹子，发红，流汗;\r\n3. 恶心，咳嗽，口腔炎;\r\n4. 喉咙阻塞;\r\n5. 肩膀僵硬;\r\n6. 呼吸困难，心悸;\r\n7. 下半身体温降低，若此现象一久时，上半身体温上升;\r\n8. 下腹部冰冷;\r\n9. 便祕，月经不顺，排尿困难，膀胱无力\r\n','您的内分泌水平在逐步下降过程中出现不均衡状态，拖累其他器官的代谢秩序,其根源与神经系统、循环系统功能下滑直接关联，可先选用神经I型作辅助改善的开始，其后用循环II型作为二期调理;\r\n您内分泌不均衡，未来会出现机体的其他器官运作异常,其根源与神经系统、循环系统功能下滑密切相关，建议从根源入手，先选用神经I型作辅助改善\r\n','1,2,3,13,15,17','1477561492'),
