('62','8','12','8','频尿(2):量增加,次数增加','3','images/8/2016/10/J2zl8qv4i8Zd48BQV1I8n41ab417DI.jpg','1.口中会发出如水果腐烂臭味(病情重时);\r\n2.腮腺肿大(代偿性机能亢进---发挥胰脏功能);\r\n3.容易发生感冒，支气管炎(免疫力下降);\r\n4.皮肤发痒(特别在阴部);\r\n5.性功能明显下降;\r\n6.下半身较瘦弱无力;\r\n7.下肢麻痺\r\n','您的前列腺功能下降，易患前列腺疾病，其根源与循环减慢密切相关，建议避免久坐，并选用循环II型辅助改善;\r\n您的前列腺功能欠佳，其来源与循环功能不足相关，建议您避免久坐，同时选用循环II型辅助调理\r\n\r\n','1,2,3,18','1477550908'),
('63','8','12','2','频尿(3):膀胱无力','1','images/8/2016/10/xsz3K1Wmam5M5Mun353rwx33x515Xq.jpg','1.老花眼，眼睛疲倦;\r\n2.重听，耳鸣;\r\n3.牙齿不好;\r\n4.下半身肌肉衰退，下半身虚弱（肾虚）;\r\n5.小腿抽筋\r\n','您血糖平衡功能不足，有糖尿病风险,为了帮助机体血糖均衡，平时避免甜食，可以先从其根源--消化代谢入手，建议您选择消化II型辅助改善; \r\n您有血糖功能平衡不足的倾向，其根源的第一步来源于消化功能的不足，建议避免甜食，并选用消化II型辅助改善 \r\n\r\n','1,2,3,13,15','1477550949'),
('64','8','12','12','夜间频尿','3','images/8/2016/10/z8T68fIB8QvZPGlzCQp6dG80ZrZQFe.jpg',' 1.老花眼，眼睛疲劳;\r\n 2.重听，耳鸣;\r\n 3.牙齿不好;\r\n 4.下半身肌肉衰退，下半身虚弱（肾虚）;\r\n 5.频尿，膀胱无力;\r\n 6.小腿抽筋\r\n','您机体细胞在老化，免疫Ⅲ型有助于您的精力提升，您选用来作为辅助改善,同时可根据自身的体能状况增加步行;\r\n您机体细胞代谢在减慢，机体精力不断老化，建议您根据自身体能状况多步行，同时需要免疫Ⅲ型调理\r\n\r\n\r\n','1,2,3,13,15','1477550987'),
('65','8','12','3','排便品质差(干结、排便时间长等)','3','images/8/2016/10/FLS4aOcAOORSRKoH0jk0rncyfaKkyc.jpg','1.喜欢食用如水/牛奶/面包/蛋糕/生菜/南方水果等让身体变冷的阴性食物;\r\n2.腹部，特别是肚腩下方是冰冷的;\r\n3.腹部肌肉衰弱\r\n','您的消化系统分解、吸收、排泄功能不完整，造成便秘,建议避免辛辣，并食用消化Ⅲ型调理;\r\n您的胃肠蠕动能力不足，建议平时避免辛辣，同时食用消化Ⅲ型调理\r\n\r\n','1,2,3,12,17','1477551010'),
('66','8','13','7','下肢浮肿','3','images/8/2016/10/oKVqfvDD55ZF2A5zdBFIzIf2V45DD5.jpg','1.体重每天增加数百克约1Kg;\r\n2.严重时出现气喘，粉红色泡沫状痰(肺水肿);\r\n3.夜间排尿次数增多;\r\n4.尿量变少;\r\n5.上半身坐起比平躺的姿势舒服\r\n','您心脏泵血功能减弱，体内堆积多余水分，有心脏衰竭的倾向,建议饮食清淡，少油少盐，并食用循环Ⅰ型辅助改善;\r\n您心脏泵血功能减弱，建议平时饮食清淡，少油少盐，并选用循环Ⅰ型辅助改善\r\n\r\n','1,2,3,13,15,17','1477551123'),
('67','8','13','2','下肢浮肿，皮肤冰冷并粗糙','3','images/8/2016/10/YU74rW5wBBLECbB904rR7047R50BLU.jpg','1. 眼皮微肿，尾毛外侧1/3变薄;\r\n2.舌头变大;\r\n3.甲状腺肿大时，在吞口水同时甲状腺随着移动 \r\n','您的甲状腺素分泌不足，机体代谢缓慢，有甲状腺机能低下症风险,其根源来于消化代谢不足，建议根据自身体能状况多步行，并食用消化Ⅱ型作辅助改善;\r\n您有甲状腺素分泌减少，影响的机体的代谢，其根源来于消化功能不完整，建议根据自身体能状况多步行，并选用消化Ⅱ型作辅助改善 \r\n\r\n','1,2,3,13,15,17','1477551148'),
('68','8','13','11','关节疼痛','3','images/8/2016/10/wQ15dgB1pdnIqrhWXqcG9oNZqDoHpZ.jpg','1.喝很多茶，水，咖啡等饮料;\r\n2.腹部（即身体的中心点处）寒冷（表示全身是冷的）;\r\n3.尿量较少;\r\n4.关节红肿\r\n','您的免疫细胞功能障碍，对关节细胞产生自身“攻击”，关节功能受损，有风湿痛的风险，建议您尽量减少身体负重，并食用免疫II型辅助调理;\r\n您的免疫系统细胞自身辨别能力有障碍，或循环不畅，造成关节功能受损，建议您尽量减少身体负重，并食用免疫II型辅助改善\r\n\r\n\r\n','1,2,3,17,23','1477551166'),
('69','8','13','1','脚拇指发红,剧痛,肿大','3','images/8/2016/10/mQuOjUb8ZUgcoQUbO0g4nUJL8Z94oQ.jpg','1.沿耳垂软骨出现肿疱---痛风结节(形为慢性化);\r\n2.疼痛处温度较低(低于25ﾟC)\r\n','您机体对尿酸代谢不完整，造成尿酸存留，有痛风的倾向,其根源为消化功能不足，建议饮食清淡，避免高蛋白，同时食用消化I型辅助改善;\r\n您的机体对尿酸代谢能力下降，为了提升您的代谢功能，建议平时饮食清淡，避免高蛋白，同时选用消化I型辅助改善\r\n\r\n','1,2,3,13,15,17','1477551186'),
('70','8','13','6','肌肉酸痛','3','images/8/2016/10/w4m6YS45usY4jj98Suh5M4ZH2h04mU.jpg',' 1.喝很多茶,水,咖啡等饮料;\r\n 2.腹部(即身体的中心点处)寒冷(表示全身是冷的);\r\n 3.尿量较少\r\n','您的神经系统过于紧绷，循环不畅，肌肉堆积过多的酸性物质，建议注意规律作息，同时需要食用神经Ⅲ型辅助改善;\r\n您的肌肉紧绷，循环减慢，建议注意作息规律，并食用神经Ⅲ型调理\r\n','1,2,3,12,13,15,17','1477551207'),
('71','8','14','4','情绪不稳定(对事对人容易敏感)','3','images/8/2016/10/U9gu6825Z5G26g6hGuuhX3Lgy9RG3H.jpeg','1.腋下体温在36.5℃以下，甚至于36℃以下','您神经系统稳定性不足，有抑郁、自律神经失调的风险，建议您根据自身体能状况多步行，并食用神经I型辅助改善;\r\n您神经系统稳定性稍弱，建议您根据自身体能状况多步行，并食用神经I型辅助改善。\r\n\r\n','1,2,3,13,15,17','1477551334'),
('72','8','14','1','黄疸(眼睑、皮肤暗黄)','3','images/8/2016/10/B0hOTtKNoKtypYYXu7yUDzjgdddz4h.jpg','1.脸部，手臂出现褐斑;\r\n2.慢性肝功能障碍---海绵状血管瘤(脸部或胸部出现如海绵般红色印记);\r\n3.手掌红斑(手掌发红)\r\n','您肝功能异常，肝细胞已经受损，有肝炎的倾向,建议平时少吃肉类，规律作息同时选用消化I型辅助改善;\r\n您肝胆功能不佳，肝细胞部分受损，建议注意作息，少吃肉类，选用消化I型辅助改善\r\n\r\n','1,2,3,13,17,18','1477551350'),
('73','8','14','6','神经痛(喝水、茶、咖啡多，尿少)','3','images/8/2016/10/rcaGZGMWiEe49ZgEImAr4b4h9cL5zl.jpg','1.腹部(即身体的中点处)寒冷(表示全身是冷的)','您水循环障碍，造成神经系统的反应，有神经痛的倾向，建议您平时避免冰凉食物，选用神经III型辅助调理;\r\n您水循环不足，造成神经系统不适，建议您平时避免冰凉食物，选用神经III型改善\r\n','1,2,3,13,15,17','1477551367'),
('74','8','14','12','易过敏(常喝水，但尿少、汗少)','3','images/8/2016/10/DTweb6FFU4Q7BGU4wXbM86F8tPv5Pm.jpg','1.舌头较厚，舌头边缘呈齿痕，舌头表面水分多;\r\n2.腋下体温于36.5℃以下（甚至或在35℃以下）;\r\n3.腹部冰凉，腹部时有水振声\r\n','您免疫细胞功能受损，造成自身细胞相互“攻击”，有过敏性疾病的倾向，建议您规律作息，避免熬夜，选用用免疫Ⅲ型作辅助调理;\r\n您免疫细胞的稳定性不足，造成过敏，建议您规律作息，避免熬夜食用免疫Ⅲ型辅助调理\r\n','1,2,3,17,23','1477551480'),
('75','8','14','11','发烧','3','images/8/2016/10/zu8LN8q828jlnQn1HQ31QqR1UjRubj.jpg','1.身体---特别是颈部到背部 ---会觉得寒冷;\r\n2.身体会发抖(抖动肌肉以促进发烧的反应);\r\n3.发冷，疲倦，饮食过量等情况会一直持续\r\n','您有发烧的现象，机体免疫细胞正进行“抗争”，建议您多喝水，同时食用免疫Ⅱ型调理改善;\r\n您免疫功能不足，建议多喝水，同时食用免疫Ⅱ型\r\n','1,2,3,17,24','1477551425'),
('76','8','14','10','易感冒','3','images/8/2016/10/gOk61jNV6nG9Kax6qjTZXww6J7Nght.jpg','1.耳朵后面头部的淋巴结肿大(感冒等病毒引起的发炎);\r\n 2.头部前侧的淋巴结肿大(细菌引起的发炎);\r\n 3.流鼻涕(流鼻水);\r\n 4.头痛;\r\n 5.发热\r\n','您的呼吸道受到感染，建议您适量增加水分摄入，食用免疫I型辅助改善;\r\n您的呼吸系统防御功能不佳，建议您适量增加水分摄入，选用免疫I型系统调理','1,2,3,17,23,24','1477551501'),
