('81','8','14','7','肥胖','3','images/8/2016/10/wnehde1fnBNJNnjTj8YqdfXND8XPh6.jpg','1.吸取过量的水分，茶，咖啡;\r\n2.体温偏低，介于35℃~36℃;\r\n3.腹部冰冷（尤其是下腹部）;\r\n4.尿量较少;\r\n5.有便秘倾向;\r\n6.有下半身肥胖，萝卜腿的倾向\r\n','您机体的血液、淋巴、水循环功能下降，造成肥胖，建议根据自身体能增加步行，并食用循环I型铺助改善;\r\n您机体内的血液、淋巴、水循环不畅，造成肥胖，建议您根据自身体能状况多步行，同时选用循环I型调理\r\n','1,2,3,10,12,17','1477551606'),
('82','8','14','12','精力衰退(记忆/思维/行动力减退)','3','images/8/2016/10/LOnoPhp6o65R116XE83nEizUi36u71.jpg',' 1.老花眼，眼睛疲劳;\r\n 2.重听，耳鸣;\r\n 3.牙齿不好;\r\n 4.下半身肌肉衰退，下半身虚弱（肾虚）;\r\n 5.频尿，膀胱无力;\r\n 6.小腿抽筋\r\n','您机体细胞在老化，细胞机能不断减弱，建议您规律作息，并食用免疫Ⅲ型辅助改善;\r\n您机体细胞老化，细胞机能逐步减弱，建议您规律作息，同时食用免疫Ⅲ型调理\r\n','1,2,3,13,14,15,17','1477551622'),
('83','8','14','1','出血现象(淤青、牙龈出血、便血等)','3','images/8/2016/10/G6Sdu6bSBsFDfdrS3aaDubIDHzRRAA.jpg','1.咳血（与肺癌有一定关系);\r\n2.吐血(与胃癌有一定关系);\r\n3.淋巴结出血(多为淋巴瘤有一定关系);\r\n4.乳腺肿物出血(与乳癌有一定关系);\r\n5.皮肤黑色肿状物出血(与皮肤癌有一定关系);\r\n6.血尿(与肾脏，膀胱癌有一定关系);\r\n7.大便后出血(与大肠至直肠癌有一定关系);\r\n8.下部不正常出血(与子宫癌有一定关系)\r\n','您的体质严重偏酸，机体细胞代谢秩序失衡，细胞容易产生变异，有一定的癌症风险，建议您在相关医疗检查治疗同时，食用消化I型+神经I型+免疫Ⅲ型作辅助调理。而您需要先从消化系统入手，其后再改善神经系统与免疫系统;\r\n您体质偏酸，细胞代谢异常，需要及时调整为弱碱性，建议您在相关医疗检查治疗同时，选用消化I型+神经I型+免疫Ⅲ型作辅助调理。根据体质的来源，消化系统的改善作为您健康改善的第一站，其后再到神经系统、免疫系统\r\n','1,2,3,12,13,15,17','1477551643');
